    <Grid container spacing={{ xs: 2, md: 3 }} columns={{ xs: 4, sm: 8, md: 12 }}>
  {Array.from(Array(6)).map((_, index) => (
    <Grid xs={2} sm={4} md={4} key={index}>
      Testing
    </Grid>
  ))}
</Grid>
    </Box>
  );
};

export default ProductSummary;
